CREATE TABLE `market_spec_contract` (
  `id` int NOT NULL AUTO_INCREMENT,
  `farmer_name` varchar(100) DEFAULT NULL,
  `buyer_name` varchar(100) NOT NULL,
  `contract_date` date NOT NULL,
  `delivery_date` date NOT NULL,
  `product` varchar(100) NOT NULL,
  `quality_req` varchar(100) NOT NULL,
  `quantity` varchar(100) NOT NULL,
  `packaging_req` varchar(100) NOT NULL,
  `buyer_responsibilities` varchar(100) NOT NULL,
  `farmer_responsibilities` varchar(100) NOT NULL,
  `price` varchar(100) NOT NULL,
  `payment_sch` varchar(100) NOT NULL,
  `termination_conditions` varchar(100) NOT NULL,
  `farmer_sign` blob NOT NULL,
  `buyer_sign` blob NOT NULL,
  PRIMARY KEY (`id`)
